import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const cardsArray = [
    {
      name: "mushroom",
      img: "img/mushroom.png"
    },
    {
      name: "Flower",
      img: "img/flower.png"
    },
    {
      name: "Star",
      img: "img/Star.png"
    },
    {
      name: "coin",
      img: "img/coin.png"
    },
    {
      name: "leaf",
      img: "img/leaf.png"
    },
    {
      name: "1Up",
      img: "img/_1Up.png"
    },
    {
      name: "bell",
      img: "img/bell.png"
    },
    {
      name: "Shine",
      img: "img/shine.png"
    },
    {
      name: "shell",
      img: "./img/shell.png"
    }
  ];
  
const cards = cardsArray.map((card)=>
<img src={card.img}></img>
);
ReactDOM.render(
    <div>
       <ul>{cards}</ul>
    </div>,
    document.getElementById('root')
  );
